        States is $83 billion each year (Greenberg, 2003). \n\nPlease note that this
        process measure for administration of the PHQ-9 depression tool, a PROM that
        is validated for both the assessment and diagnosis of depression as well as
        for monitoring ongoing outcomes of treatment, is a PAIRED process measure
        with RELATED measures of depression remission (PHQ-9 \u003c 5) and depression
        response (PHQ-9 is improved by \u003e 50%) at six and twelve months.  To quote
        a NQF Behavioral Steering Committee member as these measures were initially
        endorsed \"the best way to avoid being measured is to never give the PHQ-9\".  This
        process measure allows an understanding of the use of the tool in the target
        population, promotes frequent and follow-up contact with patients whose score
        indicates a need for treatment and serves as a catalyst in a collaborative
        care model for patients with major depression or dysthymia.  It is estimated
        that up to 90% of patients diagnosed with depression and anxiety are treated
        solely in primary care (National Institute for Health and Care Excellence,
        2011).","media_type":"text/plain"}},{"code":"CRS","value":"Source: Institute
        for Clinical Systems Improvement (ICSI) Health Care Guideline for Adult Depression
        in Primary Care (Trangle, 2016)\n\nMajor depression is a treatable cause of
        pain, suffering, disability and death, yet primary care clinicians detect
        major depression in only one-third to one-half of their patients with major
        depression (Williams Jr, 2002; Schonfeld, 1997).\n\nUsual care for depression
        in the primary care setting has resulted in only about half of depressed adults
        getting treated (Kessler, 2005) and only 20-40% showing substantial improvement
        over 12 months (Unutzer, 2002; Katon, 1999).\n\nRecommendations and algorithm
        notations supporting depression assessment and monitoring of depression outcomes
        according to ICSI''s Health Care Guideline:\n\nRecommendation:  Clinicians
        should establish and maintain follow-up with patients.  Appropriate, reliable
        follow-up is highly correlated with improved response and remission scores.  It
        is also correlated with the improved safety and efficacy of medications and
        helps prevent relapse. \n\nProactive follow-up contacts (in person, telephone)
        based on the collaborative care model have been shown to significantly lower
        depression severity (Unutzer, 2002).  In the available clinical effectiveness
        trials conducted in real clinical practice settings, even the addition of
        a care manager leads to modest remission rates (Trivedi, 2006-; Unutzer, 2002).  Interventions
        are critical to educating the patient regarding the importance of preventing
        relapse, safety and efficacy of medications, and management of potential side
        effects.  Establish and maintain initial follow-up contact intervals (office,
        phone, other) (Hunkeler, 2000; Simon, 2000).\n \nPHQ-9 as monitor and management
        tool.  The PHQ-9 is an effective management tool, as well, and should be used
        routinely for subsequent visits to monitor treatment outcomes and severity.
        It can also help the clinician decide if/how to modify the treatment plan
        (Duffy, 2008; Lowe, 2004).  Using a measurement-based approach to depression
        care, PHQ-9 results and side effect evaluation should be combined with treatment
        algorithms to drive patients toward remission.  A five-point drop in PHQ-9
        score is considered the minimal clinically significant difference (Trivedi,
        2009). \n\nEvery time that the PHQ-9 is assessed, suicidality is assessed,
        as well. If the suicidality was indeed of high risk, urgent referral to crisis
        specialty health care is advised. In case of low suicide risk, the patient
        can proceed with treatment in the primary care practice (Huijbregts, 2013).\n\nAdult
        Depression in Primary Care - Guideline Aims \n- Increase the percentage of
        patients with major depression or persistent depressive disorder who have
        improvement in outcomes from treatment for major depression or persistent
        depressive disorder. \n- Increase the percentage of patients with major depression
        or persistent depressive disorder who have follow-up to assess for outcomes
        from treatment.\n- Improve communication between the primary care physician
        and the mental health care clinician (if patient is co-managed).","name":"Clinical
